def dateFromString(dateAsString):
	year = int(dateAsString[0:4])
	month = int(dateAsString[5:7])
	day = int(dateAsString[8:10])
	return datetime.datetime(year, month, day)

def validateDate(args):
	year = args[1][0:4]
	month = args[1][5:7]
	day = args[1][8:10]

	if not year.isnumeric():
		print("This script requires 1 date argument with format YYYY-MM-DD to run")
		sys.exit()
	if not month.isnumeric():
		print("This script requires 1 date argument with format YYYY-MM-DD to run")
		sys.exit()
	if not day.isnumeric():
		print("This script requires 1 date argument with format YYYY-MM-DD to run")
		sys.exit()

	year = int(year)
	month = int(month)
	day = int(day)

	try:
		date = datetime.datetime(year, month, day)
	except ValueError:
		print("The date is not valid")
		sys.exit()

	firstDate = dateFromString("2002-03-08")
	now = datetime.datetime.now()

	if date > now:
		print("This script doesn't work in the future")
		sys.exit()
	if date < firstDate:
		print("Yu-Gi-Oh! did not exist outside Japan before 2002/03/08")
		sys.exit()

	return date

def getFullSetList():
	global cachedSets
	if len(cachedSets) == 0:
		setsUrl = "https://db.ygoprodeck.com/api/v7/cardsets.php"
		setsRequest = urllib.request.Request(setsUrl, None, header)
		with urllib.request.urlopen(setsRequest) as url:
			cachedSets = json.loads(url.read().decode())
	return cachedSets

def getSetList(date):
	sets = getFullSetList()
	legalSets = []
	for tcgSet in sets:
		try:
			setReleaseDateAsString = tcgSet['tcg_date']
			releaseYear = int(setReleaseDateAsString[0:4])
			releaseMonth = int(setReleaseDateAsString[5:7])
			releaseDay = int(setReleaseDateAsString[8:10])

			setReleaseDate = datetime.datetime(releaseYear, releaseMonth, releaseDay)

			if setReleaseDate <= date:
				code = tcgSet['set_code']
				ignore = False
				for ignoredCode in ignoredSets:
					if (ignoredCode == code):
						ignore = True
				if not ignore:
					legalSets.append(tcgSet['set_name'])
		except TypeError:
			e = "TypeError"
		except ValueError:
			e = "ValueError"
		except KeyError:
			e = "KeyError"

	return list(dict.fromkeys(legalSets))

def findBanlist(date):
	filenames = getBanlistFileNames()
	lastbanlist = "2002-03-01.json"
	for filename in filenames:
		banlistDate = dateFromString(filename)
		if (banlistDate > date):
			break
		else:
			lastbanlist = filename

	return lastbanlist

def getBanlistFileNames():
	filenames = next(walk("banlists"), (None, None, []))[2]
	return filenames

def getBanlistObject(banlistFile):
	with open("banlists/%s"%banlistFile) as jsonFile:
		banlist = json.load(jsonFile)
		jsonFile.close()
		return banlist

