def doesBanlistCardExist(banlistCard, cards):
	found = False
	for card in cards:
		if banlistCard == card['name']:
			found = True
	return found

def getCardListFromAPI():
	global cachedCards
	if len(cachedCards) == 0:
		cardsUrl = "https://db.ygoprodeck.com/api/v7/cardinfo.php"
		cardsRequest = urllib.request.Request(cardsUrl, None, header)
		with urllib.request.urlopen(cardsRequest) as url:
			cachedCards = json.loads(url.read().decode()).get('data')
	return cachedCards

def getCardList(setList, banlistFile):
	banlist = getBanlistObject(banlistFile)
	cards = getCardListFromAPI()
	cardList = []
	for card in cards:
		if card.get('card_sets') != None:
			includeInList = False
			hasCommonPrint = False
			for cardSet in card['card_sets']:
				setName = cardSet['set_name']
				rarity = cardSet['set_rarity_code']
				for validSet in setList:
					if validSet == setName:
						includeInList = True
				if rarity == '(C)' or rarity == '(SP)' or rarity == '(SSP)':
					hasCommonPrint = True 
			if includeInList:
				banlistStatus = 3
				for forbiddenCard in banlist.get('forbidden'):
					if forbiddenCard == card['name']:
						banlistStatus = 0
				for limitedCard in banlist.get('limited'):
					if limitedCard == card['name']:
						banlistStatus = 1
				for semiCard in banlist.get('semilimited'):
					if semiCard == card['name']:
						banlistStatus = 2
				simpleCard = {}
				simpleCard['name'] = card['name']
				ids = []
				images = card['card_images']
				if images != None:
					for variant in images:
						ids.append(variant['id'])
				else:
					ids.append(card['id'])
				simpleCard['id'] = ids
				simpleCard['status'] = banlistStatus
				simpleCard['isCommon'] = hasCommonPrint
				cardList.append(simpleCard)
	return cardList

def printCards(cardList, date, name, curated, force):
	if len(name)>0:
		filename = "%04d-%02d-%02d (%s).lflist.conf"%(date.year, date.month, date.day, name)
	else:
		filename = "%s.lflist.conf"%getDateAsString(date)
		if len(filename) == 0:
			filename = "%04d-%02d-%02d.lflist.conf"%(date.year, date.month, date.day)
	if curated:
		filename = "curated/%s"%(filename)
	elif name == "Advanced":
		filename = "Advanced.lflist.conf"
	else:
		filename = "all lists/%s"%(filename)

	if (not os.path.exists("lflist/%s"%filename)) or force:
		with open("lflist/%s"%filename, 'w', encoding="utf-8") as outfile:		
			if len(name) > 0:
				outfile.write("#[%s format]\n"%name)
				outfile.write("!%s (%04d.%02d.%02d)\n"%(name, date.year, date.month, date.day))
			else:
				outfile.write("#[%04d.%02d.%02d]\n"%(date.year, date.month, date.day))
				outfile.write("!%04d.%02d.%02d\n"%(date.year, date.month, date.day))
			outfile.write("$whitelist\n")
			outfile.write(animeshit)
			outfile.write("\n")
			outfile.write(rushduelshit)
			outfile.write("\n")
			for card in cardList:
				for cardId in card['id']:
					line = "%d %d-- %s\n" % (cardId, card.get('status'), card.get('name'))
					outfile.write(line)
	else:
		print("Skipped")
			
	
def generateBanlist(date, name, curated, force):
	if name != "F&L":
		print("Generating %s banlist"%(name))
	else:
		print("Generating %s Forbidden and Limited List update banlist"%(getDateAsString(date)))
	sys.stdout.flush()
	banlistFile = findBanlist(date)
	setList = getSetList(date)
	cardList = getCardList(setList, banlistFile)
	printCards(cardList, date, name, curated, force)

