		dates = []
		shortDates = []

		firstDate = datetime.datetime(2002, 3, 8)
		for filename in getBanlistFileNames():
			if dateFromString(filename) >= firstDate:
				if not filename in shortDates: 
					banlistDate = {}
					banlistDate['date'] = filename
					banlistDate['type'] = "banlist" 
					dates.append(banlistDate)
					shortDates.append(filename)

		sets = getFullSetList()
		for cardSet in sets:
			if cardSet['set_code'] == "BLCR":
				cardSet['tcg_date'] = "2022-11-18"
			date = cardSet.get('tcg_date')
			if date != None:
				if dateFromString(date) >= firstDate:
					if not date in shortDates: 
						banlistDate = {}
						banlistDate['date'] = date
						banlistDate['type'] = "release"
						banlistDate['set'] =  cardSet.get('set_code')
						banlistDate['name'] = cardSet.get('set_name')
						dates.append(banlistDate)
						shortDates.append(date)
		dates.sort(key=operator.itemgetter('date'), reverse=True)

		mostRecent = dates[0]
		generateBanlist(dateFromString(mostRecent.get('date')), "Advanced", False, True)


		goodDates = []
		for date in dates:
			if date.get("type") == "release":
				setName = date.get("name")
