def calculate_hash(file_path):
    hasher = hashlib.md5()
    with open(file_path, 'rb') as file:
        for _ in range(2):  # Skip the first two lines
            file.readline()
        buf = file.read(4096)
        while len(buf) > 0:
            hasher.update(buf)
            buf = file.read(4096)
    return hasher.hexdigest()

def find_duplicates():
    file_hashes = {}
    duplicates = []
    for root, dirs, files in walk("lflist/all lists"):
        for filename in files:
            file_path = os.path.join(root, filename)
            file_hash = calculate_hash(file_path)
            if file_hash in file_hashes:
                duplicates.append((file_hashes[file_hash], os.path.splitext(filename)[0]))
            else:
                file_hashes[file_hash] = os.path.splitext(filename)[0]
    return duplicates


